1° alianza con cámara de comercio, industria y turismo de victoria; 
2° alianza con la federación gremial, regional del comercio detallista de la región de la araucanía; 
3° alianzas, individuales, con las distintas cámaras de comercio de la provincia de malleco  y posteriormente con las cámaras de comercio de cada comuna de la región de la araucanía;
4° alianza con organizaciones sociales de la comuna, para alfabetización digital y difusión de buscador local; 
5° alianza con gobierno regional para difusión del proyecto;
6° alianza con sernatur, para difusión de proyecto; 
7° alianza con operadores turísticos, para difusión de proyecto; 
8° alianza comercial con medios locales, para difusión de proyecto; 
9° alianza con proveedor de conectividad y de tecnología ad-hoc;
10° alianza con proveedor de licencias de software; 
11° alianza con divisiones comunales de conadi, para alfabetización digital y difusión de páginas web y de buscador local en lengua mapudungún;
